import {SIDE_MENU_DISPLAY} from '../constant'

const initValue = false
export default function sideMenuReducer(preState, action){
    const {type, data} = action

    switch (type) {
        case SIDE_MENU_DISPLAY:
            return !preState

        default:
            return initValue ;
    }
}
